import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import { Provider } from 'mobx-react';
import SubscriptionPage from '../src/routes/SubscriptionPage';
import PaymentPage from '../src/routes/PaymentPage';
import ConfirmationPage from '../src/routes/ConfirmationPage';
import SuccessPage from '../src/routes/SuccessPage';

export default class App extends React.Component {
  render() {
    return (
      <Provider>
        <div className="App">
          <Router>
            <Switch>

              <Route path="/" exact>
                <SubscriptionPage/>
              </Route>

              <Route path="/payment" exact>
                <PaymentPage />
              </Route>

              <Route path="/confirm" exact>
                <ConfirmationPage />
              </Route>

              <Route path="/success" exact>
                <SuccessPage />
              </Route>

            </Switch>
          </Router>
        </div>
      </Provider>
    );
  }
}
